function LoginPage() {
    return(
        <div>
            <h2>
                이메일과 비밀번호를 입력해주세요
            </h2>
            <form>
                <div>
                    <div><span>이메일</span></div>
                    <input type="email"></input>
                </div>
            </form>
        </div>
    );
}

export default {LoginPage};
